import React from 'react'
import { useSelector, useDispatch } from "react-redux";
import { setIMGDATA } from '../redux/actions/IMGDATAaction';

function Game() {
    const { data } = useSelector((state) => state.data); 
    console.log(data)
  return (
    <div>
       {data.map((imgs, index) => (
         <div key={index}>
           <img src={imgs} alt='' />
  </div>
))}
    </div>
  )
}

export default Game
